import React, { Component } from "react";
import LinkHero from "../Components/LinkHero";



class Home extends Component {
    render() {
        return (
            <div className="Container">
               <LinkHero 
                    title="All Beers" 
                    desc="Go her for a random"
                    image="'../public/img/beers.png"
                />

            </div>
        )
    }
}

export default Home;
